# this is a wrapper class for a dictionary that contains Pokemon objects.
# key: IntEnum.value of pokemon name (i.e. the pokedex ID of the pokemon)
# value: The Pokemon object.

class PokemonDict:
    def __init__(self):
        self.Dict = dict()
        self.LongestPokemonNameLength = 0
    
    def __len__(self):
        return len(self.Dict)

    def Add(self, pokemonName: int, type1: Type.Type, type2: Type.Type, tier: Enums.Tier, evolvesNeeded, generation, canMega=False, hasAltForm=False):
        pokemon = Pokemon(pokemonName, type1, type2, tier, evolvesNeeded, generation, canMega)
        nameLength = len(pokemon.GetName())
        if nameLength > self.LongestPokemonNameLength:
            self.LongestPokemonNameLength = nameLength
        self.Dict[pokemonName] = pokemon
    
    def Get(self, pokeonId: int) -> Pokemon:
        return self.Dict[pokeonId]
    
    # THIS METHOD IS CASE SENSITIVE except for the first letter of the string.
    def GetByName(self, pokemonName: str) -> Pokemon:
        pokemonName = pokemonName.strip()
        formattedPokemonName = pokemonName[0].upper() + pokemonName[1:]#capitalize the first letter of the string to increase the odds of matching the correct pokemon
        pokemonId = Enums.PokemonName[formattedPokemonName].value
        return self.Get(pokemonId)
    
    def GetLongestPokemonNameLength(self) -> int:
        return self.LongestPokemonNameLength
    
    def GetRandom(self) -> Pokemon:
        keys = list(self.Dict.keys())
        size = len(keys)
        return self.Get(keys[random.randint(0, size-1)])
    
